import { useState, useEffect } from 'react'
import './App.css'
import { TextField } from '@material-ui/core'

function App() {

  const [query, setQuery] = useState('')
  const [data, setData] = useState([])

  const onChange = async evt => {
    setQuery(evt.target.value)
    // let response
    // try {
    //   response = await fetch('https://jsonplaceholder.typicode.com/todos')
    //   .then(response => response.json())
    //   setData(response)
    // } catch (err) {

    // }
  }

  useEffect(async _ => {
    const response = await fetch(`https://jsonplaceholder.typicode.com/todo/${query}`)
      .then(res => res.json())
    setData(response)
  }, [query])

  return (
    <div className="App">
      <header className="App-header">
      <TextField
        onChange={onChange}
        value={query}
        color='primary'
        type='search'
        label='search'
        placeholder='...'
      /> {/* text color in App.css: input */}
      <ul>
        {data?.map(d => <li key={d.title}>{d.title}</li>)}
        </ul>
      </header>
    </div>
  )

}

export default App
